import React from 'react';
import { View, Text,Dimensions } from 'react-native'
import { Entypo } from '@expo/vector-icons';
import { FontAwesome } from '@expo/vector-icons';
import { MaterialIcons } from '@expo/vector-icons';
function Bottom(props) {
    const window=Dimensions.get('window')
    return (
        <View style={{
            height: 80,
            backgroundColor: 'white',
            flexDirection: 'row',
            borderRadius:20,
            overflow:'visible'

        }}>
        <View style={{
                width:window.width/4,
                height:window.width/4,
                borderRadius:'50%',
                backgroundColor: 'red',
                marginBottom:30,
                position:'absolute',
                zIndex:40,
                bottom:4,
                left:'36%',
            }}>
            <MaterialIcons style={{
                alignItems:'center'
            }} name="home" size={50} color="black" />

            </View>
            <View style={{
                flex: 3,

                alignItems: 'center',

            }}>
                <Entypo style={{
                    marginTop: 10,
                }} name="location" size={35} color='#1C2348' />
                <Text style={{
                    color: '#1C2348'
                }}>
                    Location
                </Text>
            </View>
            
            <View style={{
                flex: 3,
                alignItems: 'center',
                
            }}>
                <FontAwesome style={{
                    marginTop: 10,
                }} name="user" size={35} color='#1C2348' />
                <Text style={{
                    color: '#1C2348'
                }}>
                    Profile
                </Text>

            </View>


        </View>

    );
}

export default Bottom;
